--Build Search Cache
local SearchTable = {};
local sub = string.sub;
local lower = string.lower;

local function GetInitial(str)
    return lower(sub(str, 1, 1))
end

local function RequsetNPCName(list)
    local numLeft = #list;
    print("Caching ".."|cffffd200"..numLeft);

    local widgetIndex = 1;
    for i = 1, numLeft do
        WidgetsContainer[widgetIndex].GetName(id);
        numLeft = numLeft - 1;
        widgetIndex = widgetIndex + 1;
        if widgetIndex > NUM_WIDGETS then
            widgetIndex = 1;
        end
    end
end

local NUM_SUBLIST = 167;
local NPCInfo = {};
local HasCached = {};

local function IsLocalizationComplete()
    local state = true;
    for i = 1, NUM_SUBLIST do
        state = state and HasCached[i];
        if not state then
            return false
        end
    end
    return true
end

local function DivdeListByInitials()
    if not IsLocalizationComplete() then return end
    print("Constructing search table...")

    local SearchTable = SearchTable;
    local initial;

    local LocalizedNames = LocalizedNames;

    for id, name in pairs(NPCInfo) do
        if not LocalizedNames[id] then
            LocalizedNames[id] = name;
        end
        initial = GetInitial(name);
        if initial then
            if not SearchTable[initial] then
                SearchTable[initial] = {id};
            else
                tinsert(SearchTable[initial], id)
            end
        end
    end

    print("Complete!")
end

local function GetSubListByIndex(index)
    local a, b = (index - 1)*1000 + 1, index*1000;
    return List["From"..a.."To"..b]
end

local function LocalizeSubList(index, cacheMode)
    local SubList = GetSubListByIndex(index);

    local strsplit = strsplit;
    local GetInitial = GetInitial;

    local function split(str)
        return strsplit(" ", str)
    end

    local After = C_Timer.After;

    local numTotal = #SubList
    local numLeft = numTotal;
    local name, id;

    local numLocalized = 0;

    local function Recursion()
        for i = 1, NUM_WIDGETS do
            if numLeft > 0 then
                id = SubList[numLeft];
                name = WidgetsContainer[i].GetName(id);
                if name ~= "" and not cacheMode then
                    LocalizedNames[id] = name;
                    numLocalized = numLocalized + 1;
                end
                numLeft = numLeft - 1;
            else
                break
            end
        end

        if numLeft > 0 then
            After(0.02, Recursion)
        else
            print("#"..index.." Finished: "..numLocalized.."/"..numTotal)
            HasCached[index] = true;
            DivdeListByInitials()
        end
    end

    RequsetNPCName(SubList);
    After(0.5, Recursion);
end

function LocalizeList(direction)
    local After = C_Timer.After;
    local delay;
    if direction and direction == -1 then
        for i = NUM_SUBLIST, 1, -1 do
            After( (NUM_SUBLIST - i + 1) * 0.8, function()
                LocalizeSubList(i, cacheMode)
            end)
        end
    else
        for i = 1, NUM_SUBLIST do
            After(i * 0.8, function()
                LocalizeSubList(i, cacheMode)
            end)
        end
    end
end

