    ModelWidgetContainer[i] = CreateVirtualModel(i);
end

local function ResetModelQueue()
    local Model;
    for i = 1, NUM_MODEL_WIDGETS do
        Model = ModelWidgetContainer[i];
        Model.isComplete = true;
        Model.index = 1;
        wipe(Model.queue)
    end
end

local function IsAllWidgetsComplete()
    local Model;
    local state = true;
    for i = 1, NUM_MODEL_WIDGETS do
        state = state and ModelWidgetContainer[i].isComplete;
        if not state then
            return false
        end
    end
    return state
end

local function BeginProcessingModel()
    local Model;
    local creatureID;
    for i = 1, NUM_MODEL_WIDGETS do
        Model = ModelWidgetContainer[i];
        creatureID = Model.queue[Model.index];
        if creatureID then
            Model.creatureID = creatureID;
            Model:SetCreature(creatureID);
        end
    end
end

local function GetModelFileIDByCreatureID(model, creatureID)
    if not model.pauseUpdate then
        model:SetCreature(creatureID);
        model.creatureID = creatureID;
    end
end

local function GetUniqueModelFromSubList(index)
    local SubList;

    local inputType = type(index);
    if inputType == "number" then
        SubList = GetSubListByIndex(index);
    elseif inputType == "table" then
        SubList = index
    else
        print("Invalid List")
        return false
    end

    if not SubList then
        print("Model Check All Done!")
        return false
    else
        if inputType == "number" then
            print("Checking List #"..index);
        else
            print("Checking List ");
        end
    end

    local After = C_Timer.After;
    local numTotal = #SubList;
    local numLeft = numTotal;
    local NUM_MODEL_WIDGETS = NUM_MODEL_WIDGETS;
    local numModelPerWidget = math.floor(numTotal/NUM_MODEL_WIDGETS + 0.5)
    print("Total "..numModelPerWidget)
    --Distribute Queue
    ResetModelQueue();

    local Model;
    local queueIndex = 1;
    local numQueued = 0;
    for i = 1, NUM_MODEL_WIDGETS do
        while (queueIndex <= numModelPerWidget) do
            numQueued = numQueued + 1;
            Model = ModelWidgetContainer[i];
            Model.queue[queueIndex] = SubList[numQueued];
            queueIndex = queueIndex + 1;
        end
        queueIndex = 1;
        if numQueued > numTotal then
            break
        end
    end

    BeginProcessingModel();

    return true
end

function GetUniqueModel()
    local index = 0;
    local After = C_Timer.After;
    local function Recursion()
        After(1, function()
            if IsAllWidgetsComplete() then
                index = index + 1;
                if GetUniqueModelFromSubList(index) then
                    Recursion()
                else
                    print("Finished!")
                end
            else
                print("in process")
                Recursion()
            end
        end);
    end

    Recursion()
end

function SiftOutModel()
    local FlatList = {};
    local numTotal = 0;
    for id, isUnique in pairs(NarciCreatureInfo.UniqueIDs) do
        if isUnique then
            numTotal = numTotal + 1;
            FlatList[numTotal] = id;
        end
    end
    print("Prepared to process ".."|cffffd200"..numTotal.."|r creatures");

    if IsAllWidgetsComplete() then
        GetUniqueModelFromSubList(FlatList)
    end
end


